import Card from "./components/Card/Card";
import Toolbar from "./components/Toolbar/Toolbar";
import "./App.css";
import useDataApi from "./service/useDataApi";

function App() {
  const result = useDataApi();

  console.log(result);
  return (
    <div className="App">
      <Toolbar />
      {/* <Card /> */}
      {result.map((item) => (
        <div className="card">
          <div className="container-2">
            <img src={"https://placeimg.com/300/200/people"} alt="people" />
            <span>ver detalhes</span>
          </div>

          <div class="parent">
            <div class="div1">
              <span>tempo restante</span>
              <span>{item.remainingTime}</span>
            </div>
            <div class="div2">
              <span>Ãºltima oferta</span>
              <div class="divider"></div>
              <span>{item.amount}</span>
            </div>
            <div class="div3"> {item.model}</div>
            <div class="div4">{item.year}</div>

            <div class="div5">
              <span>{item.km}</span>
              <div class="divider"></div>
            </div>
            <div class="div6">{/* <Button /> */}</div>
          </div>
        </div>
      ))}
    </div>
  );
}

export default App;
